import React, { useState, useEffect } from 'react';
import './App.css';

function App() {
  const [namMember, setNamMember] = useState([]);
  const [lstMember, setLstMember] = useState([]);
  const [parent, setParent] = useState([]);
  const [equal, setEqual] = useState([]);
  const [rec, setRec] = useState([]);
  const [cmp1, setCmp1] = useState(0);
  const [cmp2, setCmp2] = useState(0);
  const [head1, setHead1] = useState(0);
  const [head2, setHead2] = useState(0);
  const [nrec, setNrec] = useState(0);
  const [numQuestion, setNumQuestion] = useState(0);
  const [totalSize, setTotalSize] = useState(0);
  const [finishSize, setFinishSize] = useState(0);
  const [finishFlag, setFinishFlag] = useState(false);

  useEffect(() => {
    fetch('options.txt')
      .then(response => {
        if (!response.ok) {
          throw new Error('Failed to load options.txt');
        }
        return response.text();
      })
      .then(data => {
        const options = data.split('\n').filter(option => option.trim() !== '');
        setNamMember(options);
        if (options.length > 1) {
          initList(options);
          showImage();
        } else {
          console.error('Insufficient options to perform sorting.');
        }
      })
      .catch(error => {
        console.error('Error loading options:', error);
        alert('There was an error loading the options. Please try again later.');
      });
  }, []);

  const initList = (options) => {
    const lst = [...options.keys()].map(() => []);
    setLstMember(lst);
    setParent(Array(lst.length).fill(-1));
    setEqual(Array(options.length + 1).fill(-1));
    setTotalSize(0);
    setNrec(0);
    setCmp1(lst.length - 2);
    setCmp2(lst.length - 1);
    setHead1(0);
    setHead2(0);
    setNumQuestion(1);
    setFinishSize(0);
    setFinishFlag(false);

    lst.forEach((list, i) => {
      if (i < lst.length - 1) {
        list.push(i);
      }
    });
  };

  const showImage = () => {
    if (lstMember[cmp1] && lstMember[cmp2] && head1 < lstMember[cmp1].length && head2 < lstMember[cmp2].length) {
      document.getElementById("battleNumber").innerHTML = `battle #${numQuestion}<br>${Math.floor((finishSize * 100) / totalSize)}% sorted.`;
      document.getElementById("leftField").innerHTML = toNameFace(lstMember[cmp1][head1]);
      document.getElementById("rightField").innerHTML = toNameFace(lstMember[cmp2][head2]);
      setNumQuestion(numQuestion + 1);
    } else {
      console.error('Invalid indices for lstMember:', cmp1, head1, cmp2, head2);
    }
  };

  const toNameFace = (n) => {
    return namMember[n] || '';
  };

  const sortList = (flag) => {
    if (flag === -1) {
      setHead1(addRecord(lstMember[cmp1], head1));
    } else if (flag === 1) {
      setHead2(addRecord(lstMember[cmp2], head2));
    } else {
      setHead1(addRecord(lstMember[cmp1], head1));
      setEqual(prevEqual => {
        const newEqual = [...prevEqual];
        newEqual[rec[nrec - 1]] = lstMember[cmp2][head2];
        return newEqual;
      });
      setHead2(addRecord(lstMember[cmp2], head2));
    }
  };

  const addRecord = (list, head) => {
    // Add logic for addRecord function
    return head + 1;
  };

  return (
    <div className="App">
      <header className="App-header">
        <h1>Help Me Name My Cat!</h1>
        <p>Welcome to the ultimate cat name sorter! Please help me decide on the perfect name by choosing your favorite option in each matchup.</p>
      </header>
      <div id="battleNumber"></div>
      <div className="quiz-section">
        <div className="matchup">
          <div id="leftField" className="optionField" onClick={() => sortList(-1)}></div>
          <div className="middleField">
            <button onClick={() => sortList(0)}>I like both</button>
            <button onClick={() => sortList(0)}>No Opinion</button>
          </div>
          <div id="rightField" className="optionField" onClick={() => sortList(1)}></div>
        </div>
      </div>
      <footer>
        <p>Made with ❤️ by a fellow cat lover</p>
      </footer>
    </div>
  );
}

export default App;
